import React from 'react';
import StockTracker from './components/StockTracker';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Live Stock Tracker</h1>
      </header>
      <StockTracker />
    </div>
  );
}

export default App;
